import "./allpages.css"
import axios from 'axios'





function UserRead() {

let[set,setval]=useState("true")

 useEffect(()=>{
  axios.get("http://localhost:3000/User").then((res)=>{
// console.log(res.data);
setval(res.data)
  })
 })
  return (
    <>
     
<div className='displayData'>
  <table border='2px' className='mytable'>
<thead>
<tr>
<th>Id</th>
<th>Name</th>
<th>Age</th>
<th>City</th>
<th>Email-id</th>
<th>Edit</th>
<th>Delete</th>
</tr>

</thead>

{val?<tbody>
  {val.map((item)=>{
return(
  <tr>
    <td>{item.id}</td>
    <td>{}</td>
    <td></td>
    <td></td>
    <td></td>
    <td></td>
    <td></td>
  </tr>
)
  })}
</tbody>:<p>No data</p>}
  </table>


</div>

    </>
  )
}

export default UserRead
